select COUNT (*) from Ciudadano
use Ciudadano
GO

--LIbera todos los planes de ejecucion almacenados en la cache
DBCC FREEPROCCACHE WITH NO_INFOMSGS;

--VACIA EL BUFFER POOL, QUE ES LA MEMORIA QUE SQL SERVER UTILIZA PARA ALMACENAR 
DBCC DROPCLEANBUFFERS WITH NO_INFOMSGS;

--SELECT CONSULTA PLAN DE EJECUCION ANTES DE CREAR INDICE
SELECT nom1, nom2, ape1, ape2
FROM dbo.Ciudadano
WHERE nom1 = 'MARIA' AND ape1 = 'GOMEZ';
GO

-- Consultar índices existentes
EXEC sp_helpindex Ciudadano;
GO

-- punto 3 : Cree un índice agrupado por nom1
CREATE CLUSTERED INDEX IND_Nombre ON Ciudadano (nom1);
GO

-- punto 4: Crear índice no agrupado por ape1 y ape2
CREATE NONCLUSTERED INDEX IND_Apellidos ON Ciudadano (ape1, ape2);
GO

-- punto 5 : Verificar fragmentación del índice agrupado (captura)
DBCC SHOWCONTIG (Ciudadano, IND_Nombre);
GO

