--paso 11 : creacion de tabla ciudades  (ID, Cuidad, PaisPertenece, Población, TasaNatalidad)
CREATE TABLE ciudades (
    ID INT NOT NULL,
    Ciudad NVARCHAR(50) NOT NULL,
    PaisPertenece NVARCHAR(50) NOT NULL,
    Poblacion INT NOT NULL,
    TasaNatalidad DECIMAL(5,2) NOT NULL,
    CONSTRAINT PK_ciudades PRIMARY KEY (ID)
);

--paso 12
-- Índice agrupado sobre Ciudad
CREATE CLUSTERED INDEX IDX_ciudad ON ciudades (Ciudad);

-- Índice no agrupado sobre PaisPertenece
CREATE NONCLUSTERED INDEX IDX_Pais ON ciudades (PaisPertenece);

